let enduranceController=(()=>{return{doEndurance:function(){let e=document.getElementById("myTab").children,l=enduranceModel.getPull(),t=enduranceModel.getDip(),n=enduranceModel.getPlaceholdersPull(),d=enduranceModel.getPlaceholdersDips(),u=[17,9,8,7,6,5,5],r=[31,17,15,12,12,11,10];for(let a in e){let o=0,c=u[0],h=r[0];if(e.hasOwnProperty(a))if("pull-tab"===e[a].children[0].id){for(let e=0;e<n.length;e++)n[e].value=Math.round(l*u[e+1]/c),o+=Math.round(Number(n[e].value));document.getElementById("totalPull").value=o}else if("push-tab"===e[a].children[0].id){for(let e=0;e<d.length;e++)d[e].value=Math.round(t*r[e+1]/h),o+=Math.round(Number(d[e].value));document.getElementById("totalDip").value=o}}}}})();